'use strict';
class OffersHighLowCalculated {
    high;
    low;
    static create(high, low) {
        let result;
        result = new OffersHighLowCalculated();
        result.high = high;
        result.low = low;
        return result;
    }
    getHigh() {
        return this.high;
    }
    getLow() {
        return this.low;
    }
}
module.exports = OffersHighLowCalculated
